import React from "react";
import CreateNote from './CreateNote';
import Note from './Note';

import Header from './Header';
import Footer from './Footer';
const GoogleKeep = () => {

    const newNote = ()=>{
        alert('hell0');
    }
    return (
        <>
            <Header/>
            
                <CreateNote noteData={newNote}/>

                <Note/>
            
            <Footer/>
        </>
    )
}

export default GoogleKeep;
